import React from 'react';
import Header from '../components/Header';
import QuestionSection from '../components/QuestionSection';
import AnswerSection from '../components/AnswerSection';

const Home = () => {
  return (
    <div>
      <Header />
      <QuestionSection />
      <AnswerSection />
      <form>
        <input type='text' class='answer' placeholder='정답 입력' />
        <button class='submit-btn'>제출</button>
      </form>
      <div class='answer-box'>
        <h2 class='title-h2'>정답공간</h2>
        <ul class='answer-ul'></ul>
      </div>
      <button class='hint-btn'>힌트 보기</button>
      <div class='hint-box hidden'>
        <h2 class='title-h2'>힌트공간</h2>
        <ul class='hint-ul'></ul>
      </div>
    </div>
  );
};

export default Home;
